import React from "react";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Typewriter from 'typewriter-effect';

<Typewriter
  options={{
    strings: ['Hello', 'World'],
    autoStart: true,
    loop: true,
  }}
/>
export default function LandingPage() {





    return (
        
        <section style = {{marginTop:'275px'}}>

         
                <div className="text-center"  style = {{color:"#2C272E", fontFamily:'Poppins'}}>
                    
                    <Row className = 'justify-content-center'>
                        <Col md={3} className='align-items-center align-self-center'>
                            <h1 style = {{fontSize:'5rem'}}>Hi there!</h1>
                            <p style = {{fontSize:'1.5em'}}>my name is fahad alaraik</p>
                        </Col>
                        <Col md={3} className='align-items-center align-self-center'>
                        <img src= '../images/wave.gif' style = {{background:'transparent'}} width='226px' height='226px' />
                        </Col>
                    </Row>
                       
                   
                    


                </div>
                
             

               


        </section>
       
        

    )




}
